import React, { Component } from 'react'
export class Obsdata extends Component {
    constructor(props) {
        super(props);
        console.log(props);
        props.obsdata.forEach(obsField => {
          switch(obsField){
            case 'TEMP': this.obsdata.temp=obsField;break;
          }

        });

      };
    render() {
        return (

        <div>
            <div>{this.obsdata.temp}</div>

        </div>
        )
    }
}
export default Obsdata
